description:
And here you go, DarthScanners work on The Law of the 12 Tables.

Practicioner of modern witchcraft, Affodil, is contacted by a woman with terrible nightmares. When the woman wants to go later and visit Affodil, it turns that she has died that night mysterious circumstances. The nightmare really begins when it is determined that it goes about a ritual murder.

